/**
 * @file
 * Provides check age prompt.
 */
'use strict';

(function($, Drupal) {
  /**
   * Attaches two types of parallax to paragraphs.
   */
  Drupal.behaviors.check_age = {
    attach: function(context) {
      var $popup = $('.prompt', context);

      $popup.once('prompt-age-check').each(function() {
        var $this = $(this);

        if (readCookie('isAnAdult')) {
          hidePopup();
        } else {
          showPopup();
        }

        $this.find('#submit-age').click(confirmAge);

        function hidePopup() {
          $this.hide();
        }

        function showPopup() {
          $this.show();
        }

        function confirmAge() {
          // number of days until they must go through the age checker again
          var days = 20;
          var date = new Date();
          date.setTime(date.getTime() + days * 24 * 60 * 60 * 1000);
          var expires = '; expires=' + date.toGMTString();
          document.cookie = 'isAnAdult=true;' + expires + '; path=/';
          hidePopup();
        }

        function readCookie(name) {
          var nameEQ = name + '=';
          var ca = document.cookie.split(';');
          for (var i = 0; i < ca.length; i++) {
            var c = ca[i];
            while (c.charAt(0) == ' ') c = c.substring(1, c.length);
            if (c.indexOf(nameEQ) == 0)
              return c.substring(nameEQ.length, c.length);
          }
          return null;
        }
      });
    }
  };
})(jQuery, Drupal);
